Use LongTay
--1--
create table Subject_Combination(
	Subject_CombinationID int primary key identity,
	Subjects nvarchar(500),
	Subject_Combination_Code nvarchar(100),
	Study_Topics nvarchar(500)
)
--2--
create table Class(
	ClassID int primary key identity,
	Class_Code nvarchar(200),
	Class_Name nvarchar(200),
	Sic int,
	school_year nvarchar(255),
	Subject_CombinationID int,  
	CONSTRAINT fk_class_id_SubjectCombination FOREIGN KEY (Subject_CombinationID) REFERENCES Subject_Combination(Subject_CombinationID)
)
--3--
create table GroupSubject(
	GroupSubjectID int primary key identity,
	Subject_CombinationID int,  
	ClassID int,
	CONSTRAINT fk_GroupSubject_id_SubjectCombination FOREIGN KEY (Subject_CombinationID) REFERENCES Subject_Combination(Subject_CombinationID),
	CONSTRAINT fk_class_id_GroupSubject FOREIGN KEY (ClassID) REFERENCES Class(ClassID)
)

--4--
Create table Room(
	RoomID int primary key identity,
	RoomName nvarchar(100),
	YearOfRoom nvarchar(100),
	ClassID int,
	CONSTRAINT fk_class_id_room FOREIGN KEY (ClassID) REFERENCES Class(ClassID)
)

--5--
create table [Subjects](
	SubjectsID int primary key identity,
	Subjects_Name nvarchar(200)
)

--6--
create table Tutoring_Class(
	Tutoring_ClassID int primary key identity,
	Tutoring_Code nvarchar(200),
	Class_Tutoring nvarchar(200),
	Sic int,
	TeacherID int,
	Con int,
	school_year nvarchar(100),
	[SubjectsID] int,
	CONSTRAINT fk_SubjectsID_id_TutoringClass FOREIGN KEY ([SubjectsID]) REFERENCES [dbo].[Subjects]([SubjectsID])
)
--7--

create table Students(
	StudentID int primary key identity,
	Student_Name nvarchar(MAX),
	Email nvarchar(500),
	Phone nvarchar(500),
	Rollno nvarchar(500),
	Birthday Date,
	Cccd nVarchar(100),
	Averageofallsubjects float,
	Gender nvarchar(100),
	[Password] nvarchar(300),
	Student_Tittle nvarchar(300),
	Conduct nvarchar(300),
	Student_Status nvarchar(300),
	Religion nvarchar(300),
	Dad_Name nvarchar(300),
	Mom_Name nvarchar(300),
	Jobdad nvarchar(255),
	Jobmom nvarchar(255),
	Parent_Phone nvarchar(300),
	Parent_Phone2 nvarchar(300),
	Student_avatar nvarchar(255),
	Place nvarchar(255),
	Ethnicity nvarchar(300),
	Temporary_Address nvarchar(300),
	Permanent_Address  nvarchar(300),
	Province nvarchar(300),
	District nvarchar(300),
	Commune nvarchar(300),
	Admission_Form nvarchar(300),
	MOEC nvarchar(300),-- Ministry of education Code--
	Group_Subject nvarchar(300),
	Part nvarchar(255),
	ClassID int,
	Tutoring_ClassID int,
	CONSTRAINT fk_class_id_student FOREIGN KEY (ClassID) REFERENCES Class(ClassID),
	CONSTRAINT fk_ClassTutoring_id_student FOREIGN KEY (Tutoring_ClassID) REFERENCES Tutoring_Class(Tutoring_ClassID)
)

--8--
create table Teacher_Teaching_Service(
	teacherteachingserviceID int primary key identity,
	Nameteacher nvarchar(300),
	Phone nvarchar(300),
	Username nvarchar(300),
	Email nvarchar(500),
	[Address] nvarchar(500),
	Province nvarchar(300),
	District nvarchar(300),
	Commune nvarchar(300),
	Birthday Date,
	Cccd nvarchar(100),
	Gender nvarchar(100),
	[Password] nvarchar(300),
	Nation nvarchar(300),
	Part nvarchar(300)
)

--9--
create table Exam(
	ExamID int primary key identity,
	Exam nvarchar(255),
	ExamDate date,
	StartTime time,
	EndTime time,
	TotalTime int,
	ClassID int,
	[SubjectsID] int,
	CONSTRAINT fk_Exam_id_Class FOREIGN KEY (ClassID) REFERENCES Class(ClassID),
	CONSTRAINT fk_SubjectsID_id_exam FOREIGN KEY ([SubjectsID]) REFERENCES [dbo].[Subjects]([SubjectsID]),
)


--10--
create table Education_Of_Teacher (
	Education_Of_TeacherID int  primary key identity,
	Spl nvarchar(500),--subject professional level
	Uniondm nvarchar(500),
	Degree nvarchar(500),--degree (b, c, university )
	Main_Major nvarchar(500),
	Osq nvarchar(500),--other specialized qualifications
	Technology_Level nvarchar(500),
	Eml nvarchar(500), --educational management level
