	Level_Salary nvarchar(500),
	Salary_Days nvarchar(500),
	Quota nvarchar(500),
	Mml nvarchar(500),--Main major levels
	Mfl nvarchar(500), --main foreign language
	Jia nvarchar(500),--job incentive allowance
	Sst nvarchar(500), --soft skills training (yes or no)
