	Nation nvarchar(300),
	Officer nvarchar(300),
	Gender nvarchar(300),
	Name_Teacher nvarchar(300),
	Recruiter nvarchar(300),
	Health_Insurance nvarchar(300),
	Phone nvarchar(300),
	Recruitment_Day nvarchar(300),
	Contract_Form nvarchar(300),
	[Password] nvarchar(300),
	Position nvarchar(300),
	Religion nvarchar(300),
	Ethnicity nvarchar(300),
	Cic nvarchar(300),--citizen identification card
	Province nvarchar(300),
	District nvarchar(300),
	Commune nvarchar(300),
	[Address]  nvarchar(300),
	Avatar nvarchar(300),
	Avatar1 nvarchar(300),
	Avatar2 nvarchar(300),
	Path_Avt nvarchar(300),
	teacherteachingserviceID int,
	Education_Of_TeacherID int,
	CONSTRAINT fk_teacherteachingservice_id_Teacher FOREIGN KEY (teacherteachingserviceID) REFERENCES Teacher_Teaching_Service(teacherteachingserviceID),
