(N'Hướng dẫn tuyển sinh lớp 10 năm 2024', N'Trường THPT Long Tây xin thông báo và hướng dẫn các bậc phụ huynh và học sinh về quy trình tuyển sinh vào lớp 10 năm học 2024-2025. Dưới đây là các bước và yêu cầu quan trọng trong quá trình tuyển sinh:
1. Thời Gian Tuyển Sinh:
Nhận hồ sơ đăng ký: Từ ngày 1 tháng 6 năm 2024 đến ngày 30 tháng 6 năm 2024.
Thi tuyển sinh: Dự kiến vào ngày 15 tháng 7 năm 2024.
Công bố kết quả: Ngày 25 tháng 7 năm 2024.
Nhận hồ sơ nhập học: Từ ngày 26 tháng 7 năm 2024 đến ngày 5 tháng 8 năm 2024.
2. Điều Kiện Đăng Ký:
Đối tượng: Học sinh đã hoàn thành chương trình học lớp 9 tại các trường THCS.
Hồ sơ đăng ký:
Đơn xin dự tuyển (theo mẫu của trường).
Bản sao giấy khai sinh có công chứng.
Bản sao học bạ lớp 9 có công chứng.
Giấy chứng nhận tốt nghiệp THCS (hoặc giấy chứng nhận hoàn thành chương trình lớp 9).
Ảnh chân dung kích thước 4x6 (02 ảnh).
Giấy tờ tùy thân của phụ huynh hoặc người giám hộ (bản sao chứng minh nhân dân hoặc căn cước công dân).
3. Quy Trình Tuyển Sinh:
Nộp hồ sơ: Học sinh và phụ huynh nộp hồ sơ tại Văn phòng tuyển sinh của trường THPT Long Tây hoặc qua hệ thống trực tuyến (nếu có).
Thi tuyển: Học sinh sẽ tham gia kỳ thi tuyển sinh bao gồm các môn: Toán, Ngữ văn và Tiếng Anh. Đề thi sẽ được thiết kế để kiểm tra kiến thức và kỹ năng của học sinh theo chương trình lớp 9.
Phỏng vấn (nếu có): Một số trường hợp sẽ được phỏng vấn để đánh giá thêm về năng lực và khả năng phù hợp với chương trình học của trường.
4. Xét Tuyển và Công Bố Kết Quả:
Xét tuyển: Dựa trên điểm thi và các tiêu chí xét tuyển khác (nếu có), trường sẽ lập danh sách trúng tuyển.
Công bố kết quả: Kết quả thi tuyển sinh sẽ được công bố trên trang web của trường và tại bảng tin của trường. Học sinh trúng tuyển sẽ nhận được giấy báo trúng tuyển.
5. Nhập Học:
Đăng ký nhập học: Học sinh trúng tuyển hoàn tất thủ tục nhập học theo hướng dẫn của trường. Các hồ sơ cần nộp bao gồm giấy báo trúng tuyển, giấy khai sinh, học bạ, và các giấy tờ liên quan khác.
Đóng học phí: Phụ huynh và học sinh sẽ thực hiện các thủ tục đóng học phí và các khoản phí liên quan theo quy định của trường.
6. Liên Hệ và Hỗ Trợ:
Thông tin liên hệ:
Địa chỉ: Trường THPT Long Tây, [Địa chỉ cụ thể]
Số điện thoại: [Số điện thoại liên hệ]
Email: [Địa chỉ email liên hệ]
Hỗ trợ: Trường sẵn sàng hỗ trợ giải đáp các thắc mắc liên quan đến tuyển sinh qua điện thoại, email hoặc trực tiếp tại trường.
Chúng tôi mong muốn tất cả các học sinh sẽ có một kỳ thi tuyển sinh thành công và sẵn sàng bước vào một năm học mới với nhiều cơ hội học tập và phát triển. Chúc các em đạt được kết quả tốt nhất trong kỳ thi tuyển sinh vào lớp 10 năm 2024!', N'Tuyển sinh', '2024-07-20 08:00:00', '2024-07-20 08:00:00', N'Đã xuất bản', 'huong-dan-tuyen-sinh-lop-10.pdf',1,'2024-08-30');	
